import React, { useState, useEffect } from 'react';
import {
  Typography, Button, Dialog, DialogTitle, DialogContent,
  DialogActions, TextField, Box, Alert, Table, TableBody,
  TableCell, TableContainer, TableHead, TableRow, Paper,
  IconButton, Chip, FormControl, InputLabel, Select, MenuItem,
  Avatar, Fade, InputAdornment
} from '@mui/material';
import { Edit, Delete, Add, People, Person, Email, Lock, Badge } from '@mui/icons-material';
import { api } from '../services/api';
import { useAuth } from '../hooks/useAuth';
import { User } from '../types';

const Users: React.FC = () => {
  const { user } = useAuth();
  const [users, setUsers] = useState<User[]>([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');
  const [success, setSuccess] = useState('');
  const [dialog, setDialog] = useState(false);
  const [editingUser, setEditingUser] = useState<User | null>(null);
  const [formData, setFormData] = useState({
    username: '',
    email: '',
    password: '',
    firstName: '',
    lastName: '',
    role: 'CUSTOMER' as 'ADMIN' | 'CUSTOMER',
    isFrequentCustomer: false
  });

  useEffect(() => {
    if (user?.role === 'ADMIN') {
      fetchUsers();
    }
  }, [user]);

  if (user?.role !== 'ADMIN') {
    return (
      <Box>
        <Alert severity="error">
          No tienes permisos para acceder a esta sección.
        </Alert>
      </Box>
    );
  }

  const fetchUsers = async () => {
    try {
      const response = await api.get('/users?size=100');
      setUsers(response.data.content);
    } catch (err) {
      setError('Error loading users');
    } finally {
      setLoading(false);
    }
  };

  const handleCreate = () => {
    setEditingUser(null);
    setFormData({
      username: '',
      email: '',
      password: '',
      firstName: '',
      lastName: '',
      role: 'CUSTOMER',
      isFrequentCustomer: false
    });
    setDialog(true);
  };

  const handleEdit = (user: User) => {
    setEditingUser(user);
    setFormData({
      username: user.username,
      email: user.email,
      password: '',
      firstName: user.firstName,
      lastName: user.lastName,
      role: user.role,
      isFrequentCustomer: user.isFrequentCustomer
    });
    setDialog(true);
  };

  const handleSave = async () => {
    try {
      if (editingUser) {
        await api.put(`/users/${editingUser.id}`, formData);
        setSuccess('Usuario actualizado exitosamente');
      } else {
        await api.post('/auth/register', formData);
        setSuccess('Usuario creado exitosamente');
      }
      setDialog(false);
      setError('');
      fetchUsers();
      setTimeout(() => setSuccess(''), 3000);
    } catch (err: any) {
      setError(err.response?.data?.message || 'Error saving user');
      setSuccess('');
    }
  };

  const handleDelete = async (userId: number) => {
    if (window.confirm('¿Estás seguro de eliminar este usuario?')) {
      try {
        await api.delete(`/users/${userId}`);
        setSuccess('Usuario eliminado exitosamente');
        setError('');
        fetchUsers();
        setTimeout(() => setSuccess(''), 3000);
      } catch (err: any) {
        setError('Error deleting user');
        setSuccess('');
      }
    }
  };

  if (loading) return <Typography>Loading...</Typography>;

  return (
    <Box>
      <Box sx={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', mb: 3 }}>
        <Typography variant="h4">Gestión de Usuarios</Typography>
        <Button
          variant="contained"
          startIcon={<Add />}
          onClick={handleCreate}
        >
          Crear Usuario
        </Button>
      </Box>

      {success && <Alert severity="success" sx={{ mb: 2 }}>{success}</Alert>}
      {error && <Alert severity="error" sx={{ mb: 2 }}>{error}</Alert>}

      <TableContainer component={Paper}>
        <Table>
          <TableHead>
            <TableRow>
              <TableCell>Usuario</TableCell>
              <TableCell>Email</TableCell>
              <TableCell>Nombre</TableCell>
              <TableCell>Rol</TableCell>
              <TableCell>Cliente Frecuente</TableCell>
              <TableCell>Acciones</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {users.map((u) => (
              <TableRow key={u.id}>
                <TableCell>{u.username}</TableCell>
                <TableCell>{u.email}</TableCell>
                <TableCell>{u.firstName} {u.lastName}</TableCell>
                <TableCell>
                  <Chip 
                    label={u.role} 
                    color={u.role === 'ADMIN' ? 'error' : 'default'}
                    size="small"
                  />
                </TableCell>
                <TableCell>
                  {u.isFrequentCustomer ? '✅' : '❌'}
                </TableCell>
                <TableCell>
                  <IconButton onClick={() => handleEdit(u)} size="small">
                    <Edit />
                  </IconButton>
                  <IconButton onClick={() => handleDelete(u.id)} size="small" color="error">
                    <Delete />
                  </IconButton>
                </TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>

      <Dialog open={dialog} onClose={() => setDialog(false)} maxWidth="sm" fullWidth>
        <DialogTitle>
          {editingUser ? 'Editar Usuario' : 'Crear Usuario'}
        </DialogTitle>
        <DialogContent>
          <TextField
            label="Usuario"
            value={formData.username}
            onChange={(e) => setFormData({...formData, username: e.target.value})}
            fullWidth
            sx={{ mt: 2 }}
            disabled={!!editingUser}
          />
          <TextField
            label="Email"
            value={formData.email}
            onChange={(e) => setFormData({...formData, email: e.target.value})}
            fullWidth
            sx={{ mt: 2 }}
          />
          <TextField
            label={editingUser ? "Nueva Contraseña (opcional)" : "Contraseña"}
            type="password"
            value={formData.password}
            onChange={(e) => setFormData({...formData, password: e.target.value})}
            fullWidth
            sx={{ mt: 2 }}
          />
          <TextField
            label="Nombre"
            value={formData.firstName}
            onChange={(e) => setFormData({...formData, firstName: e.target.value})}
            fullWidth
            sx={{ mt: 2 }}
          />
          <TextField
            label="Apellido"
            value={formData.lastName}
            onChange={(e) => setFormData({...formData, lastName: e.target.value})}
            fullWidth
            sx={{ mt: 2 }}
          />
          <FormControl fullWidth sx={{ mt: 2 }}>
            <InputLabel>Rol</InputLabel>
            <Select
              value={formData.role}
              onChange={(e) => setFormData({...formData, role: e.target.value as 'ADMIN' | 'CUSTOMER'})}
            >
              <MenuItem value="CUSTOMER">CUSTOMER</MenuItem>
              <MenuItem value="ADMIN">ADMIN</MenuItem>
            </Select>
          </FormControl>
          <FormControl fullWidth sx={{ mt: 2 }}>
            <InputLabel>Cliente Frecuente</InputLabel>
            <Select
              value={formData.isFrequentCustomer ? 'true' : 'false'}
              onChange={(e) => setFormData({...formData, isFrequentCustomer: e.target.value === 'true'})}
            >
              <MenuItem value="false">No</MenuItem>
              <MenuItem value="true">Sí</MenuItem>
            </Select>
          </FormControl>
        </DialogContent>
        <DialogActions>
          <Button onClick={() => setDialog(false)}>Cancelar</Button>
          <Button onClick={handleSave} variant="contained">
            {editingUser ? 'Actualizar' : 'Crear'}
          </Button>
        </DialogActions>
      </Dialog>
    </Box>
  );
};

export default Users;
